// ==UserScript==
// @name            Florr IO 世界地图(version 5.3)
// @name:zh         Florr IO 世界地图(version 5.3)
// @name:en         Florr IO World Map(version 5.3)
// @namespace       florr.io script by lelml
// @description     一个不需要担心网络问题的版本。按 `ctrl+shift+'` 打开世界地图
// @description:zh  一个不需要担心网络问题的版本。按 `ctrl+shift+'` 打开世界地图
// @description:en  A version that doesn't need to worry about network problems. Press `ctrl+shift+'` to open the world map
// @version         1.5.3
// @author          lelml
// @license         GPL-3.0
// @match           *://*.florr.io/*
// @grant           GM_addStyle
// @compatible      firefox V50+
// @compatible      edge V50+
// @compatible      chrome V50+
// ==/UserScript==

(function() {
    'use strict'
    const customMapImgHere={
        img:"data:image/png;base64,"
    }
    GM_addStyle(`
        html>body>img#florrWorldMap{
            display:none;
            position: absolute;
            top: 50%;
            left: 50%;
            max-width: 90vw;
            max-height: 90vh;
            transform: translate(-50%, -50%);
            opacity: 0.8;
            pointer-events: none;
        }
    `)

    const mapImg=document.createElement("img")
    mapImg.setAttribute("id","florrWorldMap")
    mapImg.setAttribute("src",customMapImgHere.img)
    document.body.appendChild(mapImg)

    const mapImgElement=document.querySelector("html>body>img#florrWorldMap")
    let mapOpening=false
    let mapOpacity=8 //避免js浮点计算bug
    let onkeydownFunction=window.onkeydown?window.onkeydown:function(e){} //储存旧代码
    window.onkeydown=(e)=>{
        onkeydownFunction(e) //当 window.onkeydown 已有其他代码需要执行时，先让其他代码执行
        switch(e.key) {
            case '"': //ctrl+shift+'
                if(e.ctrlKey){
                    if(mapOpening){
                        mapOpening=false
                        mapImgElement.style.display="none"
                    }
                    else{
                        mapOpening=true
                        mapImgElement.style.display="inline"
                    }
                }
                return
            case "N": //ctrl+shift+n
                if(e.ctrlKey){
                    if(mapOpening){window.open(customMapImgHere.img)}
                }
                return
            case "-":
                if(mapOpening && mapOpacity>1){
                    console.log(mapOpacity)
                    mapOpacity-=1
                    mapImgElement.style.opacity=`${mapOpacity/10}`
                }
                return
            case "=":
                if(mapOpening && mapOpacity<10){
                    mapOpacity+=1
                    mapImgElement.style.opacity=`${mapOpacity/10}`
                }
                return
            default:
                return
        }
        e.preventDefault()
    }
})()
